    <title>教育部学历证书电子注册备案表</title>
    <style>
        *{
            margin: 0;
            padding: 0
        }
        html, body{
            background: #EFECF0;;
        }
        .h5{
            background: #fff;
            padding: 1px;
        }
        .h1{
            text-align: center;
            padding: 10px 20px;
            font-size: 16px;
            color: #111;
        }
        .title{
            display: flex;
            align-items: center;
            border-bottom: 10px solid #EFECF0;
            padding: 10px 20px;
        }
        .title .img{
            height: 80px;
            margin-right: 20px;
        }
        .title .names .sex{
            font-size: 12px;
            margin-left: 10px;
        }
        .title .names .birth{
            margin-top: 8px;
            font-size: 12px;
        }
        dd{
            border-bottom: 1px solid #EFECF0;
            display: flex;
            align-items: center;
            padding: 10px 20px;
            font-size: 12px;
        }
        dd label{
            color: #A5A5A5;
            width: 100px;
        }
        dd span{
            color: #434144;
        }
        .header{
            display: flex;
            align-items: center;
            border-bottom: 1px solid #eee;
            padding: 10px 20px;
        }
        .header .flex_1{
            flex: 1;
        }
        .header .lan{
            background: #E7E7E7;
            color: #858585;
            font-size: 12px;
            height: 24px;
            line-height: 24px;
            border-radius: 12px;
            padding-right: 10px;
        }
        .header .lan .selected{
            background: #4A9DA0;
            color: #fff;
            display: inline-block;
            padding: 0 10px;
            border-radius: 12px;
        }
        dialog{
            position: absolute;
            top: 64px;
            right: 20px;
            left: 20px;
            width: auto;
            border: 0;
            box-shadow: 0 0 8px 0 #999;
            padding: 20px;
            font-size: 12px;
            color: #444;
            line-height: 1.6;
        }
        dialog a{
            color: #316B9C;
            text-decoration: none;
            outline: none;
        }
    </style>
</head>
